import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

import Typography from '@material-ui/core/Typography';

const styles = theme => ({
  root: {
    width: '100%',
    marginTop: theme.spacing.unit * 10,
    overflowX: 'auto',
  },
  table: {
    width: '100%',
  },
});

let id = 0;
function createData(dag, datum, feestdag, dienst) {
  id += 1;
  return { id, dag, datum, feestdag, dienst };
}

const rows = [
  createData('Ma', '1 mei', '', 'ochtend'),
  createData('Di', '2 mei', '', 'ochtend'),
  createData('Wo', '3 mei', '', 'ochtend'),
  createData('Do', '4 mei', '', 'middag'),
  createData('Vr', '5 mei', '', 'middag'),
  createData('Za', '6 mei', '', ''),
  createData('Zo', '7 mei', '', ''),
  createData('Ma', '8 mei', 'Bevrijdingsdag', 'ochtend'),
  createData('Di', '9 mei', '', 'ochtend'),
  createData('Wo', '10 mei', '', 'ochtend'),
  createData('Do', '11 mei', '', 'middag'),
  createData('Vr', '12 mei', '', 'middag'),
  createData('Za', '12 mei', '', ''),
  createData('Zo', '14 mei', '', ''),
  createData('Ma', '15 mei', '', 'ochtend'),
  createData('Di', '16 mei', '', 'ochtend'),
  createData('Wo', '17 mei', '', 'ochtend'),
  createData('Do', '18 mei', '', 'middag'),
  createData('Vr', '19 mei', '', 'middag'),
  createData('Za', '20 mei', '', ''),
  createData('Zo', '21 mei', '', ''),
  createData('Ma', '22 mei', '', 'ochtend'),
  createData('Di', '23 mei', '', 'ochtend'),
  createData('Wo', '24 mei', '', 'ochtend'),
  createData('Do', '25 mei', '', 'middag'),
  createData('Vr', '26 mei', '', 'middag'),
  createData('Za', '27 mei', '', ''),
  createData('Zo', '28 mei', '', ''),
];

function SimpleTable(props) {
  const { classes } = props;

  return (
    <Paper className={classes.root}>
      <Table className={classes.table}>
        <TableHead>
          <TableRow>
            <TableCell padding="dense">Dag</TableCell>
            <TableCell padding="none" align="left">Datum</TableCell>
            <TableCell padding="none" align="left"></TableCell>
            <TableCell padding="none" align="left">Dienst</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map(row => (
            <TableRow key={row.id}>
              <TableCell padding="dense" align="justify" component="th" scope="row">
                {row.dag}
              </TableCell>
              <TableCell padding="none" align="left">{row.datum}</TableCell>
              <TableCell padding="none" align="left"><Typography variant="caption">{row.feestdag}</Typography></TableCell>
              <TableCell padding="none" align="left">{row.dienst}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </Paper>
  );
}

SimpleTable.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(SimpleTable);
